import React from 'react';
import './Header.css';
import CategoriesList from '../CategoriesList/CategoriesList';
import SearchPanel from '../SearchPanel/SearchPanel';

const Header = (props) => {
    const categories = ['covid-19', 'political', 'sport'];
    return (
        <header className='pt-4 pb-4 d-flex justify-content-between align-items-center'>
            <div className='px-4'>
                <h1 className='m-0'>News App</h1>
            </div>
            <CategoriesList
                direction='row'
                categories={categories}
            />
            <SearchPanel
                searchResults={this.state.searchResults}
            />


        </header>
    )
}

export default Header;
